package java01.algorithm.ibm;

/**
 * 두 개의 문자열이 주어졌을 때, 첫 번째 문자열이 두 번째 문자열에서 부분 수열(subsequence)로 몇 번 나타나는지를 결정합니다.
 * 부분 수열은 문자열에서 임의의 개수의 문자를 제거하여(0개일 수도 있음) 생성되며, 남아 있는 문자의 순서를 변경하지 않습니다.
 *
 * 예시:
 * S1 = "ABC"
 * S2 = "ABCBABC"
 * 문자열 S1은 S2에서 인덱스 1부터 시작하는 위치 (1, 2, 3), (1, 2, 7), (1, 4, 7), (1, 6, 7), 그리고 (5, 6, 7)의 부분 수열로 5번 나타납니다. 답은 5입니다.
 *
 * 함수 설명:
 * 아래의 에디터에서 getSubsequenceCount 함수를 완성하세요.
 * getSubsequenceCount는 다음과 같은 매개변수를 가집니다:
 *
 * string s1: 첫 번째 문자열로, 항상 길이가 3입니다.
 * string s2: 두 번째 문자열
 *
 * 반환값:
 * int: s1이 s2에서 부분 수열로 나타나는 횟수
 * 제약 조건:
 * - s1은 항상 길이가 3입니다.
 * - s2는 길이가 1 이상 10^6 이하인 문자열입니다.
 * - s1과 s2는 알파벳 대문자로만 이루어져 있습니다.
 *
 * 입력 예시:
 * s1 = "ABC"
 * s2 = "ABCBABC"
 * 출력 예시:
 * 5
 */
public class SubsequenceCount {
    public static void main(String[] args) {
//        System.out.println(solve3("ABC", "ABCBABC"));
//        System.out.println(solve2("ABC", "ABCBABC"));
//        System.out.println(solve1("ABC", "ABCBABC"));
        System.out.println(solve3("QVW", ""));
        System.out.println(solve2("QVW", ""));
        System.out.println(solve1("QVW", ""));
    }

    /**
     * TODO - 히든 케이스 실패, long 자료형 이슈
     * s1 : YRY , s2 : 
     * s1 : RHR , s2 : 
     * s1 : ZLW , s2 : 
     * s1 : OLO , s2 : 
     * s1 : QVW , s2 : 
     * s1 : NRX , s2 : 
     * s1 : DHM , s2 : 
     * s1 : AAA , s2 : 
     *
     */
    public static long solve3(String s1, String s2){
        // s1의 각 문자에 대한 카운터 초기화
        long count1 = 0, count2 = 0, count3 = 0;

        for (int i = 0; i < s2.length(); i++) {
            // 현재 s2의 문자가 s1의 세 번째 문자와 일치하는 경우,
            // 이 위치에서의 s1의 세 번째 문자가 나타날 수 있는 경우의 수는
            // 현재까지 s1의 두 번째 문자가 나타날 수 있는 경우의 수와 동일
            if (s2.charAt(i) == s1.charAt(2)) {
                count3 += count2;
            }
            // 현재 s2의 문자가 s1의 두 번째 문자와 일치하는 경우,
            // 이 위치에서의 s1의 두 번째 문자가 나타날 수 있는 경우의 수는
            // 현재까지 s1의 첫 번째 문자가 나타날 수 있는 경우의 수와 동일
            if (s2.charAt(i) == s1.charAt(1)) {
                count2 += count1;
            }
            // 현재 s2의 문자가 s1의 첫 번째 문자와 일치하는 경우,
            // s1의 첫 번째 문자가 나타날 수 있는 경우의 수는 1씩 증가
            if (s2.charAt(i) == s1.charAt(0)) {
                count1++;
            }
        }

        // 최종적으로, s1의 세 번째 문자가 s2 내에서 나타날 수 있는 총 경우의 수 반환
        return count3;
    }
    public static long solve1(String s1, String s2){
        // s1의 각 문자에 대한 카운터 초기화
        long count1 = 0, count2 = 0, count3 = 0;

        for (int i = 0; i < s2.length(); i++) {
            // 현재 s2의 문자가 s1의 첫 번째 문자와 일치하는 경우,
            // s1의 첫 번째 문자가 나타날 수 있는 경우의 수는 1씩 증가
            if (s2.charAt(i) == s1.charAt(0)) {
                count1++;
            }
            // 현재 s2의 문자가 s1의 두 번째 문자와 일치하는 경우,
            // 이 위치에서의 s1의 두 번째 문자가 나타날 수 있는 경우의 수는
            // 현재까지 s1의 첫 번째 문자가 나타날 수 있는 경우의 수와 동일
            if (s2.charAt(i) == s1.charAt(1)) {
                count2 += count1;
            }
            // 현재 s2의 문자가 s1의 세 번째 문자와 일치하는 경우,
            // 이 위치에서의 s1의 세 번째 문자가 나타날 수 있는 경우의 수는
            // 현재까지 s1의 두 번째 문자가 나타날 수 있는 경우의 수와 동일
            if (s2.charAt(i) == s1.charAt(2)) {
                count3 += count2;
            }
        }

        // 최종적으로, s1의 세 번째 문자가 s2 내에서 나타날 수 있는 총 경우의 수 반환
        return count3;
    }

    public static int solve2(String s1, String s2){
        // 문자열 s1 (1,2,3) (1,2,7) (1,4,7) (1,6,7) 의 1인덱스 위치에서 s2의 하위 시퀀스로 5번 나타납니다 (5,6,7) 답은 5이다
        int lenS1 = s1.length();
        int lenS2 = s2.length();

        // 제약 조건
        int s1Len = 3;
        int s2Len = lenS2;

        int[][] dp = new int[lenS1 + 1][lenS2 + 1];
        for(int i = 0; i < lenS2; i++){
            dp[0][i] = 1;
        }

        for(int i = 1; i <= lenS1; i++){
            for(int j = 1; j <= lenS2; j++){
                // 현재 문자 일치 하는 경우, 이전 문자까지의 횟수
                // 현재 문자를 제외한 나머지 문자열에서 처리
                if(s1.charAt(i - 1) == s2.charAt(j - 1)){
                    dp[i][j] = dp[i-1][j-1] + dp[i][j-1];
                }else{
                    dp[i][j] = dp[i][j-1];
                }
            }
        }
        return dp[lenS1][lenS2];
    }
}
